import "./Footer.css";

const Footer = () => {
    return (
        <section>
            <ul className="footer">
                <div>Darwin Image</div>
                <div>Game Event Explanation</div>
                <button>Proceed</button>
            </ul>
        </section>
    )
};

export default Footer;
